css`
  .calendar__navigation {
    display: flex;
    justify-content: space-between;
    padding-top: 8px;
  }

  .calendar__navigation simba-button {
    font-family: ${familyMono};
    font-size: ${sizeXlSize};
    line-height: ${sizeXlLineHeight};
    font-weight: ${weightMedium};
    padding: ${s0};
    margin: -2px ${s2} 0 ${s2};
  }

